import React, { useEffect } from 'react';
import { useLocation } from 'react-router-dom';

const Card = () => {
  const location = useLocation();
  const dataget = location.state;

  useEffect(() => {
    console.log('Received Data:', dataget);
  }, [dataget]);

  return (
    <div>
      <h1>Hello</h1>
      <table className="table table-bordered">
        <thead>
          <tr>
            <th>#</th>
            <th>Img</th>
            <th>Title</th>
            <th>Description</th>
            <th>Price</th>
          </tr>
        </thead>
        <tbody>
          {dataget.map((item, index) => (
            <tr key={index}>
              <th scope="row">{index + 1}</th>
              <td>
                <img src={item.img} alt="#" height={50} width={50} />
              </td>
              <td>{item.title}</td>
              <td>{item.description}</td> {/* Use 'description' instead of 'discription' */}
              <td>{item.price}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Card;
